file = open('2019/16/input','r')
startingNumber = file.read().splitlines()[0]
file.close()
import numpy as np

def allPhases(inList,num2calc, phases):
	outList = [0]*num2calc
	multList = [1]*len(inList)
	for p in range(phases-1):
		multList = np.cumsum(multList)
		multList = multList % 10

	for i in range(len(outList)):
		for j in range(len(inList)-i):
			outList[i] += inList[j+i]*multList[j]
			outList[i] = outList[i]%10
			
		outList[i] = abs(outList[i])%10
	return outList
		
startingList = [int(x) for x in startingNumber]*10000
ofset = int(startingNumber[:7])
#ofset = 303673
theList = startingList[ofset:]

numPhases = 1
outList = allPhases(theList,8,100)

print(outList)
